import './App.css';
import Homepage from './project/Homepage';
import { BrowserRouter , Router, Link, Switch, Route } from 'react-router-dom';
import AddContact from './project/AddContact';
import EditContact from './project/EditContact';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path='/' exact component={Homepage} />
          <Route path='/add-contact' component={AddContact} />                              
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
